export const SearchReducer = (state = {}, action) => {
  console.log("inside of search reducer ");
  switch (action.type) {
    case "FETC":
      console.log(action.payload);
      // return { ...action.payload.data};
      return action.payload.data;
    case "BACKEND":
      console.log("inside of backedn");
      console.log(action.payload);
      return action.payload;
    default:
      return {};
  }
};
